	t(6, {
		["description"] = "|cff66ccffWorld of Warcraft: Warlords of Draenor (colloquially referred to as WoD or Warlords) is the fifth expansion pack[2] for the massively multiplayer online role-playing game (MMORPG) World of Warcraft. It was officially announced on 8 November 2013 at BlizzCon 2013. The expansion was released on 13 November 2014, and is available for purchase on Battle.net.Across Draenor's savage jungles and battle-scarred plains, Azeroth's heroes will engage in a mythic conflict involving mystical draenei champions and mighty orc clans, and cross axes with the likes of Grommash Hellscream, Blackhand, and Nerzhul at the height of their primal power. Players will need to scour this unwelcoming land in search of allies to help build a desperate defense against the old Hordes formidable engine of conquestor else watch their own worlds bloody, war-torn history repeat itself. Warlords of Draenor is the first expansion pack to exist primarily before the main timeline, and depicts a timeline that branches from the original. It is also the second expansion that is set beyond the world of Azeroth, the first being The Burning Crusade, which featured Outland, the current, shattered incarnation of Draenor.|r",
