	t(7, {
		["description"] = "|cff66ccffWorld of Warcraft: Legion is the sixth expansion for World of Warcraft. It was announced at Gamescom on 6 August 2015 and released on 30 August 2016, selling 3.3 million copies by the end of launch day. The expansion's alpha went live on 23 November 2015, then concluded on 10 May 2016 in order for the beta to start two days later. The pre-expansion patch, Patch 7.0.3, was released on 19 July 2016. Following the events of Warlords of Draenor, the alternate Draenor's Gul'dan is expelled by his demonic masters into the original Azeroth with a special purpose - to reopen the Tomb of Sargeras and the gateway to Argus, commencing the third invasion of the Burning Legion, an invasion even greater than the War of the Ancients. Gul'dan also had to find and steal the body of the famous demon hunter Illidan Stormrage. After the defeat at the Broken Shore, the defenders of Azeroth found themselves exploring the long-forgotten Broken Isles in search of the Pillars of Creation, titan relics which were used to shape the world - and which were Azeroth's only hope for closing the massive demonic portal at the heart of the Tomb. However, the Broken Isles - a land which 10,000 years ago was home to the then mighty night elf civilization - came with their own perils to overcome, from the demon lord Xavius and his satyr armies, to the vrykul's God-King Skovald, to the powerful nightborne night elves, and the deadly naga led by Tidemistress Athissa. As part of this desperate search, the Kirin Tor, now led by Khadgar, moved the floating city of Dalaran to the shores of this land, with the city serving as a central hub for the efforts of the world's heroes. The death knights of Acherus wialsohtook eir floating necropolis to the Isles. To defend their world against the onslaught of the Legion, the heroes of Azeroth sought out legendary artifact weapons to wield in battle, but also found themselves embracing new and unexpected allies in the form of the Illidari, Illidan's elite disciples, freed in desperation by the Wardens that guarded them to fight against the Legion in this hour of need. Ongoing conflict between the Alliance and the Horde led to the formation of the class orders, with exceptional commanders putting aside faction to lead their classes in the fight against the Legion.|r",
