	t(5, {
		["description"] = "|cff66ccffWorld of Warcraft: Mists of Pandaria (colloquially referred to as MoP or Mists) is the fourth expansion pack for World of Warcraft. It was officially announced on 21 October 2011 at BlizzCon 2011, and was released on 15 September 2012. The pre-expansion patch, Patch 5.0.4, was released on 28 August 2012. On 16 October 2014, the expansion was integrated into the basic World of Warcraft package, granting all subscribers automatic access to all of the content and features of the expansion at no additional cost. Following the successful campaigns in Northrend and in the lands opened by the Shattering, and the deaths of the Lich King at Icecrown Citadel and Deathwing the Destroyer at the Maelstrom, the expansion refocuses primarily on the war between the Alliance and Horde, in the wake of the accidental rediscovery of the mythical and long-forgotten lands of Pandaria, a continent far to the south that has until now been shrouded in magical mists and touched by the ancient malevolence known only as the Sha. With both factions landing on Pandaria, adventurers rediscover the ancient pandaren people, whose wisdom will help guide them to new destinies; the Pandaren Empire's ancient enemy, the mantid; and their legendary oppressors, the enigmatic mogu. As conflicts heat up between the Alliance and Horde, the land changes over time, with subsequent patches having escalated the conflict between Alliance leader Varian Wrynn and the increasingly unbalanced Horde warchief Garrosh Hellscream... eventually leading to a schism within the Horde itself. As civil war wracks the Horde, the Alliance and forces in the Horde opposed to Hellscream's violent uprising join forces to take the battle directly to the enemy, leading to direct confrontation with Hellscream and his Sha-touched allies in the expansion's concluding showdown deep within the bowels of Orgrimmar itself.|r",
